    <div className="songMain">
    <div className="container songBoxTop">
        <p className="titleHere">{props.name}</p>
        <p className="artistHere">{props.track.artists[0].name}</p>
        <p className="popularityHere">{console.log(props.tracks)}</p>
    </div>
    <style jsx>{`
    .titleHere{
      display: inline-block;
      font-size: 16px;
    }
    .artistHere{
      font-size: 14px;
      margin:0;
      padding:0;
      display: inline-block;
      padding-left: 15px;
      color: #1DB954;
    }
    .popularityHere{
      margin:0;
      padding:0;
      float:right;
      padding-right: 10px;
    }
    .container{
      padding:0;
      margin:0;
    }
    .titleHere{
      padding: 0;
      margin: 0;
    }
    
    `}
    </style>
    </div>
    
  );
  export default Song;
